    "2015-05-06T22:36:07.983654",nt"name": "polyimide-nanocomposite-circuit-board-materials-to-mitigate-internal-electrostatic-dischar",nt"isopen":
    true,nt"url": null,nt"notes": "In Sub-topic T8.02, NASA has identified
    a need for improved circuit boards to mitigate the hazards of internal electrostatic
    discharge (IESD) on missions where high energy electrons may lead to internal electrostatic
    discharge-based failure.  The proposed STTR program will transition polymer technology
    developed at the Research Institution, the College of William and Mary, to NASA
    programs and to the private sector through the aegis of the Small Business, International
    Scientific Technologies, Inc.  The program Technical Objectives include evaluation
    and selection of nanoparticle, organometallic, and metal-ligand additives compatible
    with polyimide resins to produce electrically  conductive circuit boards that reduce
    the effects of  IESD, fabrication of polyimide films incorporating metallic nanostructures
    to optimize both volume and surface electrical resistivities, and characterization
    of electrical conductivity, electron beam charging effects, and thermo-mechanical
    properties of the polyimide resin circuit board materials.  The innovation of the
    Phase I and Phase II programs is the development of polyimide nanocomposite circuit
    board materials that are resistant to Internal Electrostatic Discharge.  The Technology
    Readiness Level (TRL) is 2 at the beginning of Phase I and 4 or higher at the end
    of Phase I. ",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
